# Notification script to run with ServiceUI
$Notification_PS1 = @'
Param(
		[string]$Type,	
		[string]$Title,					
		[string]$Message			
	 )	 
	 
$Title = $Title.Replace("_"," ")
$Message = $Message.Replace("_"," ")	 
	 
[reflection.assembly]::loadwithpartialname("System.Windows.Forms") | out-null
$path = Get-Process -id $pid | Select-Object -ExpandProperty Path            		
$icon = [System.Drawing.Icon]::ExtractAssociatedIcon($path)    		
$notify = new-object system.windows.forms.notifyicon
$notify.icon = $icon
$notify.visible = $true
$notify.showballoontip(10,$Title,$Message, [system.windows.forms.tooltipicon]::$Type)	
'@

# Export the PS1 localy
$Notification_PS1 | out-file "$env:TEMP\Toast_Notifications.ps1"	

#ServiceUI.exe converted to Base64
$ServiceUI_B64 = ""
$ServiceUI_Path = "$env:TEMP\ServiceUI.exe"
# Convert ServiceUI from Base64 to EXE
[byte[]]$Bytes = [convert]::FromBase64String($ServiceUI_B64)
[System.IO.File]::WriteAllBytes($ServiceUI_Path,$Bytes)

# Display the warning
$Title = 'Device Security Warning'
$Message = "Your computer does not have a BIOS password.`nPlease contact your help-desk"
$Title = $Title.Replace(" ","_")
$Message = $Message.Replace(" ","_")							
& "$env:TEMP\ServiceUI.exe" -process:explorer.exe C:\Windows\System32\WindowsPowerShell\v1.0\powershell.exe " -NoProfile -WindowStyle Hidden -ExecutionPolicy Bypass -File $env:TEMP\Toast_Notifications.ps1 -Type Info -Title $Title -Message $Message"
	
Exit 0